import React, {memo} from 'react';
import styled from 'styled-components';

import mq from '../style/MediaQuery';

const HeaderContainer = styled.div`
    width:100%;
    height:120px;
    background-color: #fff;
    margin: 0 auto;

    .headerWrap{
        max-width: 1200px;
        height: 100%;
        margin:0 auto;
        display: flex;
        justify-content: space-between;
        align-items: center;
        background-color: #ff0;

        .logoWrap{
            width:120px;
        }

        .navWrap{
            background-color: #f0f5;
            display: flex;
            align-items: center;
            padding-left:100px;
            max-width: 962px;

            .navItem{
                padding:15px;


                .Mainlink{
                    font-size:16px;
                    /* letter-spacing: -2.5; */
                    font-weight: 500;
                }
            }

            .subNavWrap{
                display: flex;

                

                .subNavItem{
                    .link{
                        font-size:16px;
                        letter-spacing: -2.5%;
                    }
                }
            }
        }
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div className='headerWrap'>
        <div className='logoWrap'>
            <a href='#'><img src='' alt='내일응원로고' /></a>
        </div>
        <ul className='navWrap'>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <li className='navItem'>
                <a href='#' className='Mainlink'>취업지원</a>
            </li>
            <ul className='subNavWrap'>
                <li className='subNavItem'>
                    <a href='#' className='link'>회원가입</a>
                </li>
                <li className='subNavItem'>
                    <a href='#' className='link'>로그인</a>
                </li>
            </ul>
        </ul>
      </div>
    </HeaderContainer>
  );
});

export default Header;
